  PopoverTrigger,
  PopoverContent,
  PopoverHeader,
  PopoverBody,
  PopoverFooter,
  PopoverArrow,
  PopoverCloseButton,
  PopoverAnchor,
} from '@chakra-ui/react';

function Swap() {

  const initialFocusRef = React.useRef()
  return (
    <div className="content">
      <div className='tradeBox'>
        <div className="tradeBoxHeader">
          <h3>Swap</h3>
          <Popover>
            <PopoverTrigger>
              {/* <SettingsIcon className='cog' /> */}
